import React, { useState } from 'react';

function App() {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [fullName, setFullName] = useState('');
  const [gender, setGender] = useState('');
  const [sex, setSex] = useState(''); // Male or Female

  const handleOpenModal = () => {
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setIsModalOpen(false);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(`Nama Lengkap: ${fullName}\nJenis Kelamin: ${sex}\nGender: ${gender}`);

    // Clear the form after submission
    setFullName('');
    setGender('');
    setSex('');
    handleCloseModal();
  };

  return (
    <div className="App">
      {/* Navbar */}
      <nav className="bg-blue-600 p-4">
        <div className="container mx-auto flex justify-between items-center">
          <h1 className="text-white text-xl font-bold">Login App</h1>
          <button
            onClick={handleOpenModal}
            className="text-white bg-green-500 px-4 py-2 rounded-md hover:bg-green-400"
          >
            Login
          </button>
        </div>
      </nav>

      {/* Modal */}
      {isModalOpen && (
        <div className="fixed inset-0 flex items-center justify-center bg-gray-900 bg-opacity-50">
          <div className="bg-white p-6 rounded-lg shadow-lg w-96">
            <h2 className="text-2xl font-semibold mb-4">Login Form</h2>
            <form onSubmit={handleSubmit}>
              {/* Full Name */}
              <div className="mb-4">
                <label htmlFor="fullName" className="block text-gray-700">Nama Lengkap</label>
                <input
                  type="text"
                  id="fullName"
                  value={fullName}
                  onChange={(e) => setFullName(e.target.value)}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md"
                  required
                  placeholder="Masukkan nama lengkap"
                />
              </div>

              {/* Gender */}
              <div className="mb-4">
                <label htmlFor="gender" className="block text-gray-700">Gender</label>
                <input
                  type="text"
                  id="gender"
                  value={gender}
                  onChange={(e) => setGender(e.target.value)}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md"
                  required
                  placeholder="Masukkan gender (misal: Laki-laki atau Perempuan)"
                />
              </div>

              {/* Jenis Kelamin */}
              <div className="mb-4">
                <label className="block text-gray-700">Jenis Kelamin</label>
                <div className="flex items-center space-x-4">
                  <div>
                    <input
                      type="radio"
                      id="male"
                      name="sex"
                      value="Male"
                      checked={sex === 'Male'}
                      onChange={(e) => setSex(e.target.value)}
                      className="mr-2"
                    />
                    <label htmlFor="male" className="text-gray-700">Laki-laki</label>
                  </div>
                  <div>
                    <input
                      type="radio"
                      id="female"
                      name="sex"
                      value="Female"
                      checked={sex === 'Female'}
                      onChange={(e) => setSex(e.target.value)}
                      className="mr-2"
                    />
                    <label htmlFor="female" className="text-gray-700">Perempuan</label>
                  </div>
                </div>
              </div>

              {/* Submit Button */}
              <button
                type="submit"
                className="w-full bg-blue-500 text-white py-2 rounded-md hover:bg-blue-400"
              >
                Login
              </button>
            </form>

            {/* Close Button */}
            <button
              onClick={handleCloseModal}
              className="mt-4 text-red-500 hover:text-red-400"
            >
              Tutup
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
